(255, 1, '2019-07-13 00:41:27', '2019-07-13 00:41:27', '%5B%7B%22title%22%3A%22Status%22%2C%22content%22%3A%22%3Ctable+class%3D%5Cu0027diff%5Cu0027%3E%5Cn%3Ccol+class%3D%5Cu0027content%5Cu0027+%5C%2F%3E%3Ctbody%3E%5Cn%3Ctr%3E%3Ctd+class%3D%5Cu0027diff-deletedline%5Cu0027%3Epublish%3C%5C%2Ftd%3E%3Ctd%3E%26nbsp%3B%3C%5C%2Ftd%3E%3Ctd+class%3D%5Cu0027diff-addedline%5Cu0027%3Etrash%3C%5C%2Ftd%3E%3C%5C%2Ftr%3E%5Cn%5Cn%3C%5C%2Ftbody%3E%5Cn%3C%5C%2Ftable%3E%22%7D%2C%7B%22title%22%3A%22URL%22%2C%22content%22%3A%22%3Ca+href%3D%5Cu0022http%3A%5C%2F%5C%2Fnorthgate.wordpress%5C%2Fabout-us__trashed%5C%2F%5Cu0022%3Ehttp%3A%5C%2F%5C%2Fnorthgate.wordpress%5C%2Fabout-us__trashed%5C%2F%3C%5C%2Fa%3E%22%7D%2C%7B%22title%22%3A%22Environment+Variables%22%2C%22content%22%3A%22%3Ctable+class%3D%5Cu0022table-logbook%5Cu0022%3E%3Ctr%3E%3Cth%3EREMOTE_ADDR%3C%5C%2Fth%3E%3Ctd%3E%3Cpre%3E192.168.33.1%3C%5C%2Fpre%3E%3C%5C%2Ftd%3E%3C%5C%2Ftr%3E%3Ctr%3E%3Cth%3EHTTP_X_FORWARDED_FOR%3C%5C%2Fth%3E%3Ctd%3E%3C%5C%2Ftd%3E%3C%5C%2Ftr%3E%3Ctr%3E%3Cth%3EHTTP_CLIENT_IP%3C%5C%2Fth%3E%3Ctd%3E%3C%5C%2Ftd%3E%3C%5C%2Ftr%3E%3Ctr%3E%3Cth%3EHTTP_USER_AGENT%3C%5C%2Fth%3E%3Ctd%3E%3Cpre%3EMozilla%5C%2F5.0+%28Windows+NT+10.0%3B+Win64%3B+x64%29+AppleWebKit%5C%2F537.36+%28KHTML%2C+like+Gecko%29+Chrome%5C%2F75.0.3770.100+Safari%5C%2F537.36%3C%5C%2Fpre%3E%3C%5C%2Ftd%3E%3C%5C%2Ftr%3E%3Ctr%3E%3Cth%3EHTTP_HOST%3C%5C%2Fth%3E%3Ctd%3E%3Cpre%3Enorthgate.wordpress%3C%5C%2Fpre%3E%3C%5C%2Ftd%3E%3C%5C%2Ftr%3E%3Ctr%3E%3Cth%3EREQUEST_URI%3C%5C%2Fth%3E%3Ctd%3E%3Cpre%3E%5C%2Fwp-admin%5C%2Fpost.php%3Fpost%3D198%26amp%3Baction%3Dtrash%26amp%3B_wpnonce%3Ddeba71766b%3C%5C%2Fpre%3E%3C%5C%2Ftd%3E%3C%5C%2Ftr%3E%3C%5C%2Ftable%3E%22%7D%5D', '#198 \"About us\" was moved to trash.', '', 'publish', 'closed', 'closed', '', '198-about-us-was-moved-to-trash', '', '', '2019-07-13 00:41:27', '2019-07-13 00:41:27', '', 0, 'http://northgate.wordpress/logbook/198-about-us-was-moved-to-trash/', 0, 'logbook', '', 0),
