(271, 1, '2019-07-13 00:42:38', '2019-07-13 00:42:38', '<h2>Giving</h2>		\n			<h2>We appreciate contributions of all amounts</h2>		\n			<h2>Northgate Ministry Giving</h2>		\n		<p>All of our online donations are handled through PayPal which can be accessed to the right.</p><p><em>A tax receipt will be issued after the end of the year for all donations over $20 to the email account on record.</em></p>		\n			<form action=\"https://www.paypal.com/cgi-bin/webscr\" method=\"post\" target=\"_top\"><input name=\"cmd\" type=\"hidden\" value=\"_s-xclick\" />\n<input name=\"hosted_button_id\" type=\"hidden\" value=\"E4LVAKFZ3FQGL\" />\n<table>\n<tbody>\n<tr>\n<td><input name=\"on0\" type=\"hidden\" value=\"Donate To\" />Donate To:</td>\n<td><select name=\"os0\">\n<option value=\"General Fund\">General Fund</option>\n<option value=\"Missions Fund\">Missions Fund</option>\n</select></td>\n</tr>\n</tbody>\n</table>\n<input alt=\"PayPal - The safer, easier way to pay online!\" name=\"submit\" src=\"https://www.paypalobjects.com/en_US/i/btn/btn_donateCC_LG.gif\" type=\"image\" />\n<img style=\"display: none !important;\" hidden=\"\" src=\"https://www.paypalobjects.com/en_US/i/scr/pixel.gif\" alt=\"\" width=\"1\" height=\"1\" border=\"0\" />\n</form>		\n			<h2>Mailing Address </h2>		\n		<p>Box 2151<br style=\"color: #333333; font-family: \'Lucida Sans Unicode\', \'Lucida Grande\', Garuda, sans-serif; font-size: 12px;\" />57 Foster Street<br style=\"color: #333333; font-family: \'Lucida Sans Unicode\', \'Lucida Grande\', Garuda, sans-serif; font-size: 12px;\" />Perth, ON<br style=\"color: #333333; font-family: \'Lucida Sans Unicode\', \'Lucida Grande\', Garuda, sans-serif; font-size: 12px;\" />K7H 1R9</p>		\n			<h2>Mission Fund Policy</h2>		\n		<p>Spending of funds is confined to Northgate Ministries approved programs and projects. Each contribution directed toward an approved program or project will be used as restricted with the understanding that when the need for such a program or project has been met, or cannot be completed for any reason as determined by Northgate Ministries, the remaining restricted contributions will be used where most needed..</p>', 'give', '', 'publish', 'closed', 'closed', '', 'give', '', '', '2019-07-15 19:06:01', '2019-07-15 19:06:01', '', 0, 'http://northgate.wordpress/?page_id=271', 0, 'page', '', 0),
